// 期刊hash列表
// 第一个是issueId 第二个是 resourceId
// start = 1
// end = 1000
func (h *Hash) GetHash(iid, rid int64, start, end int) (int, []Data) {
	var result = make([]Data, 0)
	var config = h.Config
	var pool = config.Pool
	if config.ChallengCode == "" || len(config.ChallengCode) > 1000 {
		return 0, nil
	}
	suf := fmt.Sprintf("%d%d", iid, rid)
	challengCode := config.ChallengCode + staticKey + suf
	code := Md5(challengCode)
	n1, _ := strconv.ParseInt(code[0:2], 16, 16)
	n2, _ := strconv.ParseInt(code[8:10], 16, 16)
	n3, _ := strconv.ParseInt(code[16:18], 16, 16)
	n4, _ := strconv.ParseInt(code[24:26], 16, 16)
	keyBase := int(n1 + n2 + n3 + n4)
	if end < start {
		end = start
	}
	for index := start; index <= end; index++ {
		mod := int(index % 4096)
		key := keyBase + mod
		if len(pool) < key {
			continue
		}
		str := pool[key]
		if strings.TrimSpace(str) == "" {
			continue
		}
		d := Data{
			Page: index,
			Hash: str,
		}
		result = append(result, d)
	}
	return 1, result
}
